import React, { Component } from "react";
import axios from 'axios';
import "./infobar.css";

class Infobar extends Component{
    constructor(prop){
        super(prop);
        this.state = {
            coin: []
        };
    }

    componentDidMount(){
        axios.get('https://api.coinmarketcap.com/v1/ticker/?convert=USD&limit=1')
            .then(response => {
                console.log(response.data[0].name);
                this.setState({
                    coin: response.data
                })
            });
    }

    render(){

        let storing = this.state.coin.rank;



        return(
            <div>
            {storing}
            <p>Hello</p>
            </div>
        )
    }
}

export default Infobar;
